import React from "react";
import logo from "./logo.svg";
import "./style.css";
import ListItem from "./components/ListItem";

function App() {
  return (
    <div className="App">
      <img src={logo} className="App-logo" alt="logo" />
      <ListItem />
    </div>
  );
}

export default App;
